import { useState } from "react";

function Table({tableNo, tableStatus}) {
    var green = '#39D1B4';
    var yellow = '#FFD712';
    var color;
    if(tableStatus === "unoccupied") color = green;
    else color = yellow;

    return (
        <div className="card">
            <h2>Table {tableNo}</h2>
            <div className="regtangle" style={{backgroundColor: color}}></div>
            <button className="ubutton">Update</button>
        </div>
    );
}
   
export default Table;
